window.bookSummaryJSON = "<p>The<i> New York Times</i> and <i>USA Today</i> best-selling series</p> <p>Betrayal and sacrifice in the skies...</p> <p>Ten years ago, Hell Diver Xavier \"X\" Rodriguez fell to Earth. Those he left behind went on without him aboard the airship he once called home. Michael Everheart - the boy once known as Tin - has grown into a man and the commander of Hell Diver Raptor Team. While Michael dives to help keep the <i>Hive</i> in the air, Captain Leon Jordan rules with an iron fist at the helm of the ship. But unrest stirs under his strict leadership as a prophecy of hope sweeps the lower decks.&nbsp;</p> <p>When a mysterious distress signal calls the Hell Divers to the surface, Michael and his loyal team begin to uncover long-buried truths and the secrets Captain Jordan will do anything to keep. They dive so humanity survives...but will they survive the ultimate betrayal?&nbsp;</p> <p>Nicholas Sansbury Smith delivers another heart-pounding thriller in <i>Hell Divers II:</i> <i>Ghosts</i>, the second audiobook in the acclaimed science fiction series.&nbsp;</p>"; 
